var title_f38_33_39441="Sites of reentry";
var content_f38_33_39441=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F82249&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F82249&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sites of reentry in supraventricular tachyarrhythmias",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 421px; height: 392px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Reentry may occur around a fixed anatomic obstacle or may be functional, developing in the absence of an anatomic obstacle and resulting from the intrinsic heterogeneity of electrophysiologic properties of the myocardial tissue. Reentrant circuits leading to a supraventricular tachyarrhythmia may develop in various parts of the heart: within and around the sinoatrial node (sinus node reentry); within the atrial myocardium (atrial tachycardia, atrial flutter, or atrial fibrillation); within the atrioventricular (AV node) due to the presence of a slow and fast pathway (atrioventricular nodal reentrant tachycardia); or involving the AV node and an accessory pathway (AP) (atrioventricular reentrant tachycardia) which include Kent, Mahaim, James, and atriohisian (AH) fibers.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
