"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Surfactant",
"       </td>",
"       <td class=\"subtitle1\">",
"        Origin",
"       </td>",
"       <td class=\"subtitle1\">",
"        Concentration of phospholipids",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initial dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Repeat dosing schedule",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Poractant alfa",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        Porcine lung minces, lipid extraction with purification using liquid-gel chromatography",
"       </td>",
"       <td>",
"        76 mg PL per mL",
"       </td>",
"       <td>",
"        2.5 mL/kg (contains 190 mg/kg PL)",
"       </td>",
"       <td>",
"        1.25 mL/kg (95 mg/kg PL) every 12 hours as needed up to 2 total doses",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Calfactant",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        Calf lung lavage, lipid extraction",
"       </td>",
"       <td>",
"        35 mg PL per mL",
"       </td>",
"       <td>",
"        3 mL/kg (contains 105 mg/kg PL)",
"       </td>",
"       <td>",
"        3 mL/kg (105 mg/kg PL) every 12 hours as needed up to 3 total doses",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Beractant",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"       <td>",
"        Bovine lung minces, lipid extraction. Supplemented with DPPC, palmitic acid and tripalmitin.",
"       </td>",
"       <td>",
"        25 mg PL per mL",
"       </td>",
"       <td>",
"        4 mL/kg (contains 100 mg/kg PL)",
"       </td>",
"       <td>",
"        Repeat same dose every 6 hours as needed for total of 4 doses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        BLES&reg;",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"       <td>",
"        Bovine lipid extract surfactant (available in Canada)",
"       </td>",
"       <td>",
"        27 mg PL per mL",
"       </td>",
"       <td>",
"        5 mL/kg (contains 135 mg/kg PL)",
"       </td>",
"       <td>",
"        Repeat same dose as needed up to a maximum of 4 doses within the first 5 days of life",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
