" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cholangiocarcinoma of the common bile duct, as seen during an ERCP procedure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 269px; height: 294px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Following administration of contrast material into the biliary system and duodenum during an endoscopic retrograde cholangiopancreatography (ERCP) examination (black), circumferential narrowing of the distal common bile duct is produced by a cholangiocarcinoma (black arrow). The tumor is causing proximal bile duct dilatation and is also extending into the adjacent duodenum (white arrow), producing a C-shaped eccentric impression.",
